import React from 'react';
import ImageUpload from './components/ImageUpload'; // Import the ImageUpload component
import ImageDisplay from './components/ImageDisplay'; // Import the ImageDisplay component

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>MERN Image Upload and Retrieval</h1>
      </header>
      <div className="App-content">
        <ImageUpload /> {/* Include the ImageUpload component */}
        <ImageDisplay imageId="IMAGE_ID_HERE" /> {/* Replace "IMAGE_ID_HERE" with the actual image ID */}
      </div>
    </div>
  );
}



export default App;
